    ## Approach 2 removing instead of swapping in previous case
    def canReorderDoubled(self, arr: List[int]) -> bool:
        arr.sort()
        i=0
        while(i<len(arr)-1):
            # print(f"Array after {i} iteration -> ", arr)
            j =i+1
            size = len(arr)
            while(j<len(arr)):
                # print(f"i is {i} value is {arr[i]} and j in {j} value is {arr[j]}")
                if arr[i]<0 and arr[i]%2==1:
                    # print("-ve odd")
                    return False
                if(arr[i]<0 and arr[i]/2 == arr[j]) or (arr[i]>=0 and arr[i]*2 == arr[j]):
                    # print("pair remove",arr[i],arr[j])
                    arr.pop(j)
                    arr.pop(0)
                    # print("updated arr after remove - ",arr )
                    break
                if(j==len(arr)-1 and size == len(arr)):
                    # print(j,len(arr),"False")
                    return False
                j = j+1

            if len(arr)==0:
                return True

